import { NavLink } from "react-router-dom";

const PageTopNavListApp = (props) => {
  return (
    <NavLink to={props.link}>
      <div
        style={{
          backgroundColor: props.isActive ? "red" : "white",
          color: props.color,
        }}
        className=" page_top_nav_link"
      >
        {props.name}
      </div>
    </NavLink>
  );
};
export const UserManagementTab = ({ activeTabName }) => {
  return (
    <>
      <div className="page_top_nav_div_top">
        <div className="page_top_nav">
          {data.map((val, i) => {
            return (
              <PageTopNavListApp
                isActive={activeTabName === val.name}
                key={i}
                {...val}
              />
            );
          })}
        </div>
      </div>
    </>
  );
};
export const InquiryManagementTab = ({ activeTabName }) => {
  return (
    <>
      <div className="page_top_nav_div_top">
        <div className="page_top_nav">
          {data.map((val, i) => {
            return (
              <PageTopNavListApp
                isActive={activeTabName === val.name}
                key={i}
                {...val}
              />
            );
          })}
        </div>
      </div>
    </>
  );
};
